import React from "react";
import styled from "styled-components";
const UL = styled.ul`
    margin: 0;
    padding: 0;
    background-color: #405cc1;
    color: white;
    margin: 15px;
    padding: 10px;
`;
const P = styled.p`
    font-size: 1.2em;
    margin: 0 3px;
`;
const List = ({ day, children }) => {
    return (
        <UL>
            <P>{day}</P>
            {children}
        </UL>
    );
};

export default List;
